Secrets of Scotland Yard

History Documentary hosted by Samuel West, published by PBS broadcasted as part of PBS Secrets series in 2013 - English narration


Information
------------------------------

No police institution in the world captures the public imagination in quite the same way as Scotland Yard. Today, the name is synonymous with London's Metropolitan Police, one of the oldest detective forces in the world. From Britain's most famous serial killer to the biggest jewelry heist in history, we reopen classified files to reveal how a century and more of crime detection has sown the seeds of modern-day policing. We follow crime historians as they retrace the steps of Scotland Yard's earliest detectives and enter a grisly world of treachery, violence and murder most foul.

